import React from "react"
import $ from "jquery"

function auth() {
    var email = $("#ed_email").val()
    var password = $("#ed_password").val()
    $.ajax({
        url: "http://localhost:3000/login",
        type: "post",
        dataType: "json",
        contentType: "application/x-www-form-urlencoded",
        data: {
            "email" : email,
            "password" : password
        }
    })
}

export default() =>

<div style={{display: "grid"}}>
    <form method="post">
    <img src="static/src/LOGO PETROKIMIA GRESIK.png"/>

    <input
      type = "email"
      name = "email"
      id = "ed_email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      id = "ed_password"
      placeholder = "Password"/>

      <div className="regist"><a href='/Registration'>Don't have account? Register Here!</a></div>
      <button className="login">Login</button>
    </form>
<style jsx global>{`
    body {
        background: #3EC400;
        font-family: 'Open Sans', sans-serif;
    }

    div {
        margin: 0 auto;
        display: block;
    }

    .regist{
        margin-left: 35%;
        font-size: 12px;
        position: relative;
        right: 0;
        margin-top: 1%;
        font-size: 12px;
    }

    .login{
        width: 15%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 42.5%;
        display: block;
        font-size: 30px;
        padding: 5px 5px;
    }

    #ed_email{
        width: 28%;
        position: relative;
        right: 0;
        margin-top: 20%;
        margin-left: 36%;
        display: block;
        font-size: 20px;
        border: none;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    #ed_password{
        width: 28%;
        position: relative;
        right: 0;
        margin-top: 1%;
        margin-left: 36%;
        display: block;
        font-size: 20px;
        border: none;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }
`}</style>
</div>
